import React from "react";
import { useAuth } from "./auth";

function Login() {
  return (
    <div>
      <h1>Login</h1>
      <label>UserName</label>
      <input type="text" name="name" id="name" placeholder="Enter userName" />
      <button>Login</button>
    </div>
  );
}
export default Login;
